DECLARE @DLL_SphericalQuickhull VARBINARY(MAX);
SET @DLL_SphericalQuickhull = ;
DECLARE @DLL_SphericalHtm VARBINARY(MAX);
SET @DLL_SphericalHtm = ;
DECLARE @DLL_SphericalLib VARBINARY(MAX);
SET @DLL_SphericalLib = ;
DECLARE @DLL_SphericalSql VARBINARY(MAX);
SET @DLL_SphericalSql = ;
