-------------------------------------------------------------------
-- Installs the Spherical and HTM assemblies
-------------------------------------------------------------------
-- History:
--		2007-10-20 Removed IO, now included Lib
-------------------------------------------------------------------

--====================================================================
/*
  First should set the DLL assemblies
  For example, 
     DECLARE @DLL_SphericalLib VARBINARY(MAX); 
	 SET @DLL_SphericalLib = 0x...
*/
BEGIN TRY
	DROP ASSEMBLY [SphericalSql]
	PRINT 'Dropped assembly SphericalSql'
END TRY
BEGIN CATCH END CATCH
--
BEGIN TRY
	DROP ASSEMBLY [SphericalHTM]
	PRINT 'Dropped assembly SphericalHTM'
END TRY
BEGIN CATCH END CATCH
--
BEGIN TRY
	DROP ASSEMBLY [SphericalQuickhull]
	PRINT 'Dropped assembly SphericalQuickhull'
END TRY
BEGIN CATCH END CATCH
--
BEGIN TRY
	DROP ASSEMBLY [Spherical.Quickhull]
	PRINT 'Dropped assembly Spherical.Quickhull'
END TRY
BEGIN CATCH END CATCH
--
BEGIN TRY
	DROP ASSEMBLY [SphericalIO]
	PRINT 'Dropped assembly SphericalIO'
END TRY
BEGIN CATCH END CATCH
--
BEGIN TRY
	DROP ASSEMBLY [SphericalLib]
	PRINT 'Dropped assembly SphericalLib'
END TRY
BEGIN CATCH END CATCH
--

PRINT '*** CREATE ***'
BEGIN TRY
	CREATE ASSEMBLY [SphericalLib]
	AUTHORIZATION [dbo]
	FROM @DLL_SphericalLib
	WITH PERMISSION_SET = SAFE;
	PRINT 'Created assembly SphericalLib';
END TRY
BEGIN CATCH
	PRINT 'Could not create assembly SphericalLib !!!';
	PRINT ERROR_MESSAGE();	
END CATCH
--
BEGIN TRY
	CREATE ASSEMBLY [SphericalQuickhull]
	AUTHORIZATION [dbo]
	FROM @DLL_SphericalQuickhull
	WITH PERMISSION_SET = SAFE;
	PRINT 'Created assembly SphericalQuickhull';
END TRY
BEGIN CATCH
	PRINT 'Could not create assembly SphericalQuickhull !!!';
	PRINT ERROR_MESSAGE();
END CATCH
--
BEGIN TRY
	CREATE ASSEMBLY [SphericalHTM]
	AUTHORIZATION [dbo]
	FROM @DLL_SphericalHTM
	WITH PERMISSION_SET = SAFE
	PRINT 'Created assembly SphericalHTM';
END TRY
BEGIN CATCH
	PRINT 'Could not create assembly SphericalHTM !!!';
	PRINT ERROR_MESSAGE();
END CATCH
--
BEGIN TRY
	CREATE ASSEMBLY [SphericalSql]
	AUTHORIZATION [dbo]
	FROM @DLL_SphericalSql
	WITH PERMISSION_SET = SAFE;
	PRINT 'Created assembly SphericalSql'
END TRY
BEGIN CATCH
	PRINT 'Could not create assembly SphericalSql !!!';
	PRINT ERROR_MESSAGE();
END CATCH
GO

